import React from 'react';
import { MDBInput, MDBRow, MDBCol } from 'mdb-react-ui-kit';
import { useState } from 'react';



export default function CreateFlight(){
    const [planecode, setCode] = useState()
    const [departairport, setDepart] = useState()
    const [arriveAirport, setArrive] = useState()
    const [seats, setSeats] = useState()

    const handleSubmit = (e) => {
        e.preventDefault();
        axios.get('http://localhost:8081/createflight', {PlaneCode: planecode, departairport: departairport})
      .then( response => {
        console.log(response.data)
      })
      .catch(err=>{console.log(err)})

    return(
        <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
        
          sx={{
            margin: -5,
            marginTop: 10,
            marginBottom:5,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            boxShadow: '0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19)',
            padding: '1.5rem',
            opacity: '75%',
            backgroundColor: 'white',
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
            <LockOutlinedIcon/>
          </Avatar>
          <Typography component="h1" variant="h5">
            Register
          </Typography>
          <Box component="form" onSubmit={handleSubmit}>
            <Grid container spacing={1} >
              <Grid item xs={12} sm={6}>
                <TextField
                margin='normal'
                required
                id='fname'
                label='First Name'
                name='fname'
                value = {fname}
                onChange={(e) => setFname(e.target.value)}
                />
                </Grid>
              <Grid item xs={12} sm={6}>
            <TextField
              margin='normal'
              id="lname"
              label="Last Name"
              name='lname'
              value={lname}
              onChange={(e) => setLname(e.target.value)}
            />
                </Grid>
              <Grid item xs={12}>
              <TextField
                margin='normal'
                fullWidth
                id='uname'
                label='Username'
                name='uname'
                value={uname}
                onChange={(e) => setUname(e.target.value)}
              />
            </Grid>
            <Grid item xs={12}>
            <TextField
                margin="normal"
                required
                fullWidth
                id="email"
                label="Email Address"
                name="email"
                autoComplete="email"
                autoFocus
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </Grid>
            <Grid item xs={12}>
            <TextField
                margin="normal"
                required
                fullWidth
                id="phone"
                label="Phone Number"
                name="phone"
                autoComplete="phone"
                autoFocus
                value={phone}
                onChange={(e) => setPhone(e.target.value)}
              />
            </Grid>
            <Grid item xs={12}>
            <TextField
                margin="normal"
                required
                fullWidth
                id="passport"
                label="Passport Number"
                name="passport"
                autoFocus
                value={passport}
                onChange={(e) => setPassport(e.target.value)}
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                margin="normal"
                required
                fullWidth
                name="password"
                label="Password"
                type="password"
                id="password"
                autoComplete="current-password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
                </Grid>
              <Grid item xs={12} sm={6}>
              <TextField
                margin="normal"
                required
                fullWidth
                name="password"
                label="Confirm Password"
                type="password"
                id="password"
                autoComplete="current-password"
                value={password2}
                onChange={(e) => setPassword2(e.target.value)}
              />
                </Grid>

            </Grid>
            <FormControlLabel
              control={<Checkbox value="remember" color="primary" />}
              label="Remember me"
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2}}
              id="SignBox"
              >
              Sign In
            </Button>
            <Grid container>
              <Grid item xs>
                <Link href="/login" variant="body2">
                  Have an Account?
                </Link>
              </Grid>
            </Grid>
          </Box>
        </Box>
      </Container>
    )
 }
}
